import React from 'react';

// Create Accordion using React:

const App = () => {
  return (
    <>
      <div className="main_div">
        <div className="center_div">
          <h1>React ToDo List</h1>
          <input />
          <button>Click Me</button>

          <ul>
            <li>Mango</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default App;
